import Header from './Header';
import TestHeader from '../components/TestHeader';

const layoutStyle = {
  margin: -9,
};

const Layout = props => (
  <div style={layoutStyle}>
    <TestHeader />
    {props.children}
  </div>
);

export default Layout;
